import React from "react";

const Footer = () => {
  return (
    <footer
      style={{
        padding: "40px 20px",
        backgroundColor: "#f5f5f5",
        marginTop: "auto",
      }}
    >
      <div style={{ textAlign: "center" }}>
        <p>&copy; 2024 LookPick. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
